package repository

import (
	"crypto/rand"
	"errors"
	"fmt"
	"io"
	"log"

	"github.com/jinzhu/gorm"
	"github.com/yaserali542/account-Service/models"
	"golang.org/x/crypto/scrypt"
)

func DropAccountTable(db *gorm.DB) error {
	return db.DropTable(&models.Account{}).Error
}
func MigrateAccountTable(db *gorm.DB) error {
	if !db.HasTable(&models.Account{}) {
		sqlStr := `CREATE EXTENSION IF NOT EXISTS "uuid-ossp";`
		tx := db.Exec(sqlStr)

		if tx.Error != nil {
			fmt.Println(tx.Error)
		} else {
			fmt.Println("create extension ran successfully")
		}
	}

	if err := db.AutoMigrate(&models.Account{}); err.Error != nil {
		return err.Error
	}
	if !db.HasTable(&models.Account{}) {
		return errors.New("table doesn't exist")
	}
	return SeedAccountRecords(db)

}

func SeedAccountRecords(db *gorm.DB) error {

	samplePhoto := ""

	if err := db.First(&models.Account{}).Error; errors.Is(err, gorm.ErrRecordNotFound) {
		password := "admin"
		salt := make([]byte, PW_SALT_BYTES)

		_, err = io.ReadFull(rand.Reader, salt)
		if err != nil {
			log.Fatal(err)
		}
		hash, err := scrypt.Key([]byte(password), salt, 1<<14, 8, 1, PW_HASH_BYTES)
		if err != nil {
			log.Fatal(err)
		}
		fmt.Println("salted hash password is  :", string(hash))
		fmt.Println("salt used  is  :", string(salt))

		testObject := models.Account{
			FirstName:      "Mohammed Yaser",
			LastName:       "Ali",
			ProfilePicture: []byte(samplePhoto),
			UserName:       "admin",
			HashedPassword: hash,
			EmailAddress:   "yaserali542@gmail.com",
			Salt:           salt,
		}
		db.Create(&testObject)
	}
	return nil
}
